import React, { useState, useEffect } from 'react';


function App() {
  const [tableData, setTableData] = useState([]);

  useEffect(() => {
    fetch('http://localhost:3001/emplyees') // Update with your backend URL
      .then(response => response.json())
      .then(data => setTableData(data))
      .catch(error => console.error('Error fetching data:', error));
  }, []);

  return (
    <div className="App">
      <h1>MySQL Table Data</h1>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>firsrName</th>
             <th>lastname</th>
<th>department</th>
<th>salart</th>
           
          </tr>
        </thead>
        <tbody>
          {tableData.map(row => (
            <tr key={row.id}>
              <td>{row.id}</td>
              <td>{row.first_name}</td>
              <td>{row.last_name}</td>
<td>{row.department}</td>
<td>{row.salary}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
